import React from 'react'
import { FiMenu } from 'react-icons/fi'

function Navbar() {
    return (
        <div className='w-screen h-[80px] z-10 bg-zinc-200 fixed drop-shadow-lg'>
            <FiMenu className='text-red-400 text-2xl' />
        </div>
    )
}

export default Navbar
